INSERT INTO `jm_article` VALUES ('2', '2012-08-25 12:25:04', '\0', '<p>\r\n	<img alt=\"\" src=\"http://img30.360buyimg.com/pophelp/g5/M00/00/1B/rBEIC0-_V0AIAAAAAAALYDXRMQoAAAKtwP_8REAAAt4250.jpg\" /> \r\n</p>\r\n<ul>\r\n	<li>\r\n		<strong>A.</strong>赠送积分：在商城中部分商品设有积分项，购买赠送积分的商品后，商城系统会对客户的积分进行增加并逐次累积。\r\n	</li>\r\n	<li>\r\n		<strong>B.</strong>商品评价：使用商品评价功能，如有价值我们将给与相应的积分奖励；举办的活动也可能会有积分赠送。\r\n		<ul>\r\n			<li>\r\n				<strong>1.</strong>所有评价一律由系统自动赠送积分，无效评价不给分。只能对在180天内购买的商品进行评价；赠品可以评价但不赠送积分。\r\n			</li>\r\n			<li>\r\n				<strong>2.</strong>购买时间相差超过15日的不同订单中的相同商品，可以分别评价并获得积分；同一订单或相隔15日内订单中的相同商品，只有一次评价可以获得积分。\r\n			</li>\r\n			<li>\r\n				<strong>3.</strong>根据不同会员级别和产品价格，产品评价积分赠予列表：\r\n				<div>\r\n					<img alt=\"\" src=\"http://img30.360buyimg.com/pophelp/g13/M07/10/14/rBEhUlJcqkoIAAAAAAFTrpCViqIAAEJFwPkougAAVPG867.jpg\" /> \r\n				</div>\r\n			</li>\r\n			<div>\r\n				<div>\r\n					请您提高评价质量，以下评价一律不再赠送积分：\r\n				</div>\r\n				<ul>\r\n					<li>\r\n						<strong>1）</strong> 拷贝自己或者他人评价内容超过80%以上，以字数为准。\r\n					</li>\r\n					<li>\r\n						<strong>2）</strong> 优点、缺点内容重复超过60%以上的。\r\n					</li>\r\n					<li>\r\n						<strong>3）</strong> 使用标点符号过多的。\r\n					</li>\r\n					<li>\r\n						<strong>4）</strong> 评价内容没有任何参考价值、被5名以上网友举报或者违反法律、法规的。\r\n					</li>\r\n					<li>\r\n						<strong>5）</strong> 无效评价数量超过5条，则一年内该id号参与的产品评价均不赠送积分，过往的无效评价可以不计！\r\n					</li>\r\n				</ul>\r\n			</div>\r\n			<li>\r\n				<strong>4.</strong>发表评价即可获得积分，每个商品<span>（除图书、音像）</span>的前5位评价用户可获得2倍积分！\r\n			</li>\r\n		</ul>\r\n	</li>\r\n	<li>\r\n		<strong>C.</strong>晒单：通过晒单贴向其他网友分享所购商品的购物经历、使用心得、真实照片等，通过审核后可获得10个积分奖励：晒单贴须包含一定的介绍文字及3张以上真实拍摄的原创商品照片；一件商品购买多个只能发表一个晒单贴；图书音像商品、赠品晒单贴暂时不奖励积分。\r\n		<div>\r\n			为奖励优先进行晒单的会员，同一个商品的前五个晒单贴可以获得积分奖励，其余晒单贴不再奖励积分。\r\n		</div>\r\n	</li>\r\n	<li>\r\n		<strong>D.</strong>推荐好友：铁牌（含）以上用户，通过提供的推荐方式推荐好友成功注册后，如果好友完成了第一个订单且订单金额超过100元（含），七天后推荐者将获得10个积分作为奖励。查看详细&gt;&gt;\r\n	</li>\r\n	<li>\r\n		<strong>E.</strong>满意度评价奖励积分：满意度评价是用户对购物过程中所提供的服务进行的评价，如：出库速度，配送速度，服务态度等。评价大于100元的订单可以获得2个积分(订单完成3个月内有效)。<br />\r\n		<div>\r\n			注：夺宝岛订单（拍卖和一口价）不能参与商品评价、晒单及满意度评价，不获得评价积分。\r\n		</div>\r\n	</li>\r\n	<p>\r\n		<img alt=\"\" src=\"http://img30.360buyimg.com/pophelp/g5/M02/00/1B/rBEIC0-_V0wIAAAAAAAMl2mZnFwAAAKuQIw0pgAAAyv650.jpg\" /> \r\n	</p>\r\n	<ul>\r\n		<li>\r\n			<strong>A.</strong>积分可在<span></span>兑换可购物的电子券；即：进入“买家中心”，点击“我的积分”， 电子券兑换比例为10：1，如：兑换面值10元的购物券需要100积分，依此类推； 也可进入积分兑换平台兑换其他商家提供的各种优惠券，<span></span>进入积分兑换平台&gt;&gt;\r\n		</li>\r\n		<li>\r\n			<strong>B.</strong>使用积分兑换的购物券为电子券，有效期为一年，电子京券每次可使用多张，自成功兑换之日起计算。兑换的京东购物券仅限本ID使用，不能折算为现金、也不能再次兑换为积分；\r\n		</li>\r\n		<li>\r\n			<strong>C.</strong>使用积分兑换电子券规则：10元券需要铁牌以上会员级别兑换，20元券需要银牌以上会员级别兑换，50元券需要金牌以上会员级别兑换；100元券需要钻石以上会员级别兑换；\r\n		</li>\r\n		<li>\r\n			<strong>D.</strong>您所购商品属于赠送积分类的商品，在办理退、换货时，会根据您购买时赠送的积分进行扣除。如您的积分不足，我们将会在您的退款金额中减去相应的金额，按照1：10的比例进行折算。即1元抵10个积分；\r\n		</li>\r\n		<li>\r\n			<strong>E.</strong>积分可以直接兑换电子书刊\r\n			<div>\r\n				a.积分和人民币比例为10:1。\r\n			</div>\r\n			<div>\r\n				b.电子书产品如选择积分支付，需全额用积分支付，暂不支持与其他支付方式混合使用（其他支付方式包括在线支付、余额、优惠券、京东卡/京东E卡等）\r\n			</div>\r\n			<div>\r\n				c.购买规则：订单金额（单位：元）*10，若为整数，即为所需积分数，若为非整数，则进位至整数。例，订单金额￥2.90元，需29积分兑换，订单金额为￥2.93，则需要30积分兑换。\r\n			</div>\r\n			<div>\r\n				去购买电子书&gt;&gt;\r\n			</div>\r\n		</li>\r\n		<li>\r\n			<strong>F.</strong>如您违反的相关约定，可以扣除相应的积分。<br />\r\n			<div>\r\n				举例：上门自提订单原则上免收配送费用，但如果一个ID帐号在一个月内有过1次以上或一年内有过3次以上，在规定的时间内无理由不履约提货，我司将在相应的ID帐户里按每单扣除50个积分做为运费；<br />\r\n对于货到付款的订单，如果一个ID帐号在一个月内有过1次以上或一年内有过3次以上，无理由不接收我司配送的商品，我司将在相应的ID帐户里按每单扣除50个积分做为运费；<br />\r\n时间计算方法为：成功提交订单后向前推算30天为一个月，成功提交订单后向前推算365天为一年，不以自然月和自然年计算。\r\n			</div>\r\n在商品退货时，需扣除购买该商品时通过评价或晒单所获得的积分及相应优惠，如账户积分已使用，则从商品退款金额中相应扣除。\r\n		</li>\r\n		<li>\r\n			<strong>G.</strong>积分只适用于终端个人消费者和经过认证的以终端消费为目的企业用户的下单情形，对积分使用有最终解释权。\r\n		</li>\r\n	</ul>\r\n	<p>\r\n		<a><img alt=\"\" src=\"http://img30.360buyimg.com/pophelp/g5/M02/00/1B/rBEIDE-_V18IAAAAAAAJ8vAi-UEAAAKuQLNQqgAAAoK685.jpg\" /><br />\r\n</a> \r\n	</p>\r\n积分查询： 每位客户在您自己账户中的“买家中心-我的积<a href=\"http://bankws.jd.com/score/Integral/ScoreExhibit.aspx\" target=\"_blank\">分</a>-积分记录”中可查询到您的积分详细情况。\r\n	<div>\r\n		注：积分规则由商城制定并依据国家相关法律法规及规章制度予以解释和修改，规则以网站公布为准。\r\n	</div>\r\n</ul>\r\n<br />', '', '', '0', '积分兑换说明', '', '98304', null, '1');
INSERT INTO `jm_article` VALUES ('3', '2012-08-25 12:30:55', '\0', '<p align=\"center\">\r\n	<span><img src=\"http://images.qianlong.com/mmsource/images/2014/11/21/shhlyp2014112109.jpg\" /><br />\r\n国家互联网信息办公室主任鲁炜浏览凤凰网世界互联网大会专题报道，并予以肯定。</span>\r\n</p>\r\n<p>\r\n	　　首届世界互联网大会20日在乌镇继续进行。中午，在多个会见间隙，凤凰卫视、凤凰网独家采访到国家互联网信息办公室主任鲁炜。鲁炜表示，大会取得了预期成果，成功搭建起中外互联互通的国际平台和国际互联网共享共治的中国平台。\r\n</p>\r\n<p>\r\n	　　首次世界互联网大会，云集近百个国家和地区的一千多名政要、互联网精英、学者，超出了鲁炜的预期。鲁炜表示，举办世界互联网大会，旨在搭建两个平台。\r\n</p>\r\n<p>\r\n	　　一是中国与世界互联互通的国际平台，让各方人士通过这样一个平台围绕互联网的发展、互联网的安全、互联网的共享、互联网的共治，寻找共识。“我们可以有分歧，但不能没有沟通，现在看来我们能够找到共识，而且共识大过分歧。”鲁炜说。\r\n</p>\r\n<p>\r\n	　　二是国际互联网共享共治的中国平台。通过这个平台，让中国的互联网企业、互联网精英、互联网理论研究者和管理互联网的政府部门，能够与世界更好地进行沟通、对接，让中国更好地走向世界，同时让世界更好地了解中国。\r\n</p>\r\n<p>\r\n	　　鲁炜告诉凤凰网，互联网的发展离不开政府的推动，离不开政府的环境，离不开政府的监管，而政府就是要搭建一个平台，提供一个公平竞争的环境，做好基础设施建设。\r\n</p>\r\n<p>\r\n	　　中国目前有超过6亿网民，成为世界上网民最多的国家，但还有7亿多没有使用互联网的人，鲁炜指出，他们更需要互联网，更需要通过互联网了解外面的世界，更需要通过互联网来脱贫致富。鲁炜对凤凰网说，因此，“中国政府不仅要为这6亿网民服务，还要顾及另外7亿人民，像总书记在贺词中说得那样，让互联网发展成果惠及13亿中国人民，就要让那几亿人都成为网民。这也是我们的中国梦”。\r\n</p>\r\n<p>\r\n	　　鲁炜最后还肯定了凤凰网在这次世界互联网大会报道上的表现。\r\n</p>', '', '', '1', '世界互联网大会成功搭建两个平台', '', '1', null, '1');
