INSERT INTO `jm_article` VALUES ('32776', '2012-12-23 21:44:01', '\0', '<p style=\"text-indent:24.0pt;\">\r\n	<span></span> \r\n</p>\r\n<p align=\"center\">\r\n	<span style=\"font-size:16pt;font-family:楷体_GB2312;color:#000000;\"><span style=\"font-size:16px;font-family:SimSun;color:#000000;\"><strong>关于我们</strong></span></span>\r\n</p>\r\n<p align=\"left\">\r\n	<b><span style=\"font-size:16.0pt;font-family:楷体_GB2312;\"><span style=\"font-size:16px;font-family:SimSun;color:#999999;\">&nbsp;&nbsp;&nbsp; <span style=\"background-color:#FFFFFF;color:#000000;\">鱼鱼软件公司是一家从事互联网、物联网、移动互联网技术研究与开发的创新型企业，专注于提供智慧城市产品及解决方案，主要产品包括智慧社区、智慧交通、智能停车、智能导游、智能考勤等，致力于成为国内领先的智慧城市技术服务提供商。</span> <br />\r\n</span></span></b>\r\n</p>\r\n<p>\r\n	<b><span style=\"font-size:16.0pt;font-family:楷体_GB2312;\"><span style=\"font-size:16px;font-family:SimSun;color:#999999;\"><span style=\"background-color:#FFFFFF;color:#000000;\"><strong> &nbsp;&nbsp;&nbsp; </strong></span><span style=\"background-color:#FFFFFF;color:#000000;\"><strong>团队核心成员具有计算机专业大学本科、硕士以上教育背景，有中科院、海尔等工作经历，对互联网、移动互联网、电子商务有深刻理解，熟悉互联网、物联网、\r\nGPS定位、WIFI热点、蓝牙等技术，具有大型电商平台架构和技术开发经验，具有丰富的智慧社区、智能导游、智能考勤等智慧应用产品及项目开发经验。更\r\n重要的是，我们决心致力于此！</strong></span></span></span></b> \r\n</p>\r\n<p align=\"left\">\r\n	<br />\r\n</p>\r\n<p style=\"text-indent:32.25pt;\">\r\n	<span style=\"font-size:16.0pt;font-family:仿宋_GB2312;\"><span></span><span></span></span> \r\n</p>', '', 'about', '0', '关于鱼鱼', '', '163841', null, '1');
INSERT INTO `jm_article` VALUES ('65536', '2012-08-25 20:37:52', '\0', '<p>\r\n	新华网杭州１１月２１日电（记者冯源）首届世界互联网大会２１日中午在浙江乌镇闭幕，这是我国举办的规模最大层次最高的互联网大会。在闭幕式上，国家互联网信息办公室主任鲁炜将世界互联网大会永久会址的牌匾授予乌镇。\r\n</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;本次大会为期３天，国家互联网信息办公室副主任任贤良介绍说，来自全世界近１００个国家和地区的逾１０００位政府官员、国际机构负责人、专家和企业家等围绕着“互联互通·共享共治”主题，就国际互联网治理、移动互联网、互联网新媒体、网络空间法治化、网络名人、跨境电子商务、网络安全、打击网络恐怖主义等１０多个分议题深入交换意见，共商互联网发展大计，达成了广泛共识。他同时表示，通过本次大会，中国与世界的互联互通，有了一个国际平台，国际互联网的共享共治有了一个中国平台。借助这样一个平台，中国希望与世界一道，不断促进网络空间的互联互通，永葆互联网蓬勃的生命力。\r\n</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;“我想引用唐代著名诗人杜甫的一首诗《春夜喜雨》中的诗句：‘野径云俱黑，江船火独明’，我希望世界互联网大会就是江上的一艘船，照亮黑暗，指引我们这一段由信息技术引领的人类文明的变化。”韩国前议长金炯旿表示，互联网创造了一个高度连接的社会，给人们带来了移动的生活，也意味着个人的伦理价值比以往任何时候都要重要。互联网是以自由为基础的，而自由带来了责任。而加勒比地区电信联盟主席菲利普·鲍威尔表示，这次会议表达了发展中国家合作的要求，“我们要缩小数字鸿沟，分享行动，保证发展中国家能够成为新兴市场互联网市场的重要组成部分。”\r\n</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;在会上，工业和信息化部副部长尚冰说，下一步中国将在建设宽带发展新平台、开辟融合新领域、形成协同创新新模式、打造安全可信新空间、构建合作共赢新空间五个方面做好重点工作。而浙江省委常委、宣传部长葛慧君也表示，浙江将以世界互联网大会永久落户浙江乌镇为契机，加快推进浙江互联网和信息经济发展，努力把乌镇打造成为全球文明的互联网小镇，把世界互联网大会打造成全球互联网界的群英会。（完）\r\n</p>', '', '', '0', '首届世界互联网大会闭幕', '', '1', null, '1');
INSERT INTO `jm_article` VALUES ('65537', '2012-08-25 20:38:09', '\0', '<p style=\"color:#333333;text-indent:2em;font-size:14px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n	1、广物汽贸股份有限公司的广物汽贸湛江长安福特4S店工程已由广东物资集团公司批准建设。现决定对该项目的工程监理进行招标，选定承包人。\r\n</p>\r\n<p style=\"color:#333333;text-indent:2em;font-size:14px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n	2、项目的概况：<br />\r\n（1）建设地点：广东省湛江市赤坎区东盛路7号-S16（海田国际汽车城内）<br />\r\n（2）建设规模：4510.14平方米， 结构形式：钢结构、框架结构<br />\r\n（3）资金来源： 企业自筹，总投资额：约1100万元<br />\r\n（4）招标内容：土建工程、装修工程、水电安装工程、室外工程。<br />\r\n（5）计划总工期120日历天；<br />\r\n（6）工程质量要求符合品牌展厅验收标准及建筑工程验收规范等国家标准。\r\n</p>\r\n<p style=\"color:#333333;text-indent:2em;font-size:14px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n	3、投标申请人须是具备建设行政主管部门核发的建筑工程监理乙级或以上资质的独立法人或其他组织，信誉良好，完成过类似汽车展厅项目，近三年内没有发生过诉讼和上访事件。\r\n</p>\r\n<p style=\"color:#333333;text-indent:2em;font-size:14px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n	4、该监理工程招标实行资格后审，凡具备承担招标工程项目的能力并具备规定的资格条件的监理单位，均可对参加投标。\r\n</p>\r\n<p style=\"color:#333333;text-indent:2em;font-size:14px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n	5、投标申请人接受报名时间为2014年3月11日至2014年3月17日，下午17时00分\r\n</p>\r\n<p style=\"color:#333333;text-indent:2em;font-size:14px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n	6、招标文件获取方式：申请人按照招标公告联系人的联系方式与招标联系人取得联系，详细报出申请单位名称，法人代表姓名，委托代理人姓名、手机号码，招标联系人通过短信方式告知获取招标文件、招标图纸的邮箱、密码，由申请人自行下载。\r\n</p>\r\n<p style=\"color:#333333;text-indent:2em;font-size:14px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n	7、申请人严格按照招标文件要求编制投标文件，在规定的时间里递交投标文件。\r\n</p>\r\n<p style=\"color:#333333;text-indent:2em;font-size:14px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n	8、投标人提出申请并经确认后，没有参加投标的，今后将永久取消其投标资格。\r\n</p>\r\n<p style=\"color:#333333;text-indent:2em;font-size:14px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n	招 标 人：广物汽贸股份有限公司<br />\r\n办公地址：广州市白云区机场路888号1号楼201投资发展部<br />\r\n联 系 人：曾先生 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;办公电话：020-86095503<br />\r\n日期：2014年3月11日\r\n</p>', '', '', '0', '湛江长安福特监理招标公告', '', '1', null, '1');
INSERT INTO `jm_article` VALUES ('98305', '2012-08-25 22:41:27', '\0', '<p style=\"color:#333333;text-indent:43px;font-size:14px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:仿宋_gb2312;font-size:21px;\">根据广物汽贸股份有限公司公开征集会计师事务所和评估公司备选库的要求，在中介机构自愿申报的基础上，经我公司评审小组人员</span><span style=\"font-family:\'times new roman\';font-size:21px;\">评审和确认</span><span style=\"font-family:仿宋_gb2312;font-size:21px;\">，选取以下<span style=\"font-family:\'times new roman\';\">10</span>家中介机构进入我公司<span style=\"font-family:\'times new roman\';\">2014</span>年度会计师事务所和评估公司备选库，现予以公示，具体名单如下：</span><span style=\"font-family:\'times new roman\';font-size:21px;\"></span>\r\n</p>\r\n<p style=\"color:#333333;text-indent:11px;font-size:14px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:仿宋_gb2312;font-size:21px;\">会计师事务所：</span><span style=\"font-family:\'times new roman\';font-size:21px;\"></span>\r\n</p>\r\n<table style=\"border:1px solid #F1F1F1;color:#333333;font-family:Arial, Helvetica, sans-serif;font-size:12px;background-color:#FFFFFF;padding:0px 7px;\">\r\n	<tbody>\r\n		<tr>\r\n			<td valign=\"middle\" width=\"46\" style=\"border:1px solid #000000;\">\r\n				<p style=\"text-indent:2em;font-size:14px;text-align:center;\">\r\n					<span style=\"font-family:仿宋_gb2312;font-size:21px;\">1</span><span style=\"font-family:\'times new roman\';font-size:21px;\"></span>\r\n				</p>\r\n			</td>\r\n			<td valign=\"middle\" width=\"511\">\r\n				<p style=\"text-indent:2em;font-size:14px;\">\r\n					<span style=\"font-family:仿宋_gb2312;font-size:21px;\">中审亚太会计师事务所有限公司广东分公司</span><span style=\"font-family:\'times new roman\';font-size:21px;\"></span>\r\n				</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td valign=\"middle\" width=\"46\">\r\n				<p style=\"text-indent:2em;font-size:14px;text-align:center;\">\r\n					<span style=\"font-family:仿宋_gb2312;font-size:21px;\">2</span><span style=\"font-family:\'times new