INSERT INTO `jm_article` VALUES ('131072', '2012-08-25 22:43:36', '\0', '<p>\r\n	11月20日8:30-11:00(2.5小时)华美宫枕水会议三层\r\n</p>\r\n<p>\r\n	　　议题描述\r\n</p>\r\n<p>\r\n	　　跨境电子商务作为推动经济一体化、贸易全球化的技术基础，具有非常重要的战略意义。跨境电子商务不仅冲破了国家间的障碍，使国际贸易走向无国界贸易，同时它也正在引起世界经济贸易的巨大变革。\r\n</p>\r\n<p>\r\n	　　讨论内容\r\n</p>\r\n<p>\r\n	　　跨境商务与跨境生态\r\n</p>\r\n<p>\r\n	　　主持人\r\n</p>\r\n<p>\r\n	　　阿里巴巴集团资深副总裁 张蔚\r\n</p>\r\n<p>\r\n	　　演讲嘉宾\r\n</p>\r\n<p>\r\n	　　马云 阿里巴巴集团执行主席\r\n</p>\r\n<p>\r\n	　　葛道远 亚马逊中国总裁，全球副总裁\r\n</p>\r\n<p>\r\n	　　沃尔夫冈拜耳 新加坡邮政集团CEO\r\n</p>\r\n<p>\r\n	　　傅益翔 意中商会副主席，意大利参考标准有限公司首席合伙人\r\n</p>\r\n<p>\r\n	　　张勇 阿里巴巴集团首席运营官\r\n</p>\r\n<p>\r\n	　　参会嘉宾\r\n</p>\r\n<p>\r\n	　　中国、美国、欧盟、日本、韩国、新加坡、印度等国家电子政务、互联网和电子商务领域的知名专家。\r\n</p>', '', '', '0', '跨境电子商务和全球经济一体化', '', '1', null, '1');
INSERT INTO `jm_article` VALUES ('131073', '2012-08-25 22:43:58', '\0', '<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 首届世界互联网大会在昨天迎来高潮，由苹果、高通、领英和汤森路透高官组成的世界强队，对话马云、李彦宏、雷军、刘强东、张朝阳为代表的中国互联网代表队。不过想象中的中外对撞并未出现，中国队再次发挥内战内行的特色，几个人唇枪舌剑不亦乐乎。\r\n</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 不过，在媒体一遍遍刷各种大佬相声的时候，也不应该忘记，他们每个人都知道出现在台上的意义，都会把为公司代言隐隐放在首位。剥去口水战和互黑、自黑的外衣，每个人的发言，其实都隐隐透露出他们对自家公司的总结、设想与设定。作为<strong>唯一进入乌镇大会的自媒体人</strong>，淼叔不受传统媒体出稿周期和体裁的限制，准备用几篇文章来分析当家人表现得比较鲜明的几家公司。\r\n</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 今天先从百度说起。李彦宏主要表达的两个意思，一个是百度移动化的痛苦与反思，一个是移动互联网时代的战略定位。前者适合一些PC互联网业务占据优势的科技企业和传统企业参考，后者则适合百度生态圈的参与者或竞争者了解。\r\n</p>\r\n<p>\r\n	李彦宏是这几位互联网领袖中跟别人争论比较少的一位，其实也比较符合百度的特点，一个技术型的公司更多会把精力放在基础设施和研发上，因为别人都需要用。就像前不久双十一各家电商围攻阿里、阿里自己突破记录，可百度的股价反而涨幅最大，因为谁都得找他买流量。\r\n</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 李彦宏的对话中首先透露的一个信息是，百度内部自己也曾意识到，在2012年左右，百度曾经差点错失移动互联网机遇，他当时的想法，即使今天也足以惕厉某些仍然没意识到移动时代到来的公司或机构。当时他认为，PC上的搜索移植到手机上很简单，只不过是屏幕小一点速度慢一点，\"看到的都是不好的地方\"，但是他们没想到手机是人们随时随地拿着的设备，而屏幕虽然小，但上下滑动也具有无限的空间。\r\n</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 所以后来有了那封著名的呼唤狼性的内部信，有了19亿天价收购91，也有了全产品线疯狂的移动化。这段\"有太多的坑要填，整个的过程痛苦而危险\"。李彦宏并没有详细列举有哪些坑、哪些痛苦，但从2011年刚因为千团大战而赚得盆满钵满，急转之下到2012年底突然发现危机四伏，正与马化腾所说的那句话契合：巨人倒下时，身体还是温的。甚至百度与腾讯经受移动互联网冲击的时间也差不多，马化腾后来也曾表示\"如果不是微信，腾讯也很难守住\"。马云在这方面没有过这么鲜明的表示，但他撸起袖子推来往、两年内把阿里巴巴的移动营收占比从百分之十几提高到三分之一以上，紧迫感一望可知。\r\n</p>\r\n<p>\r\n	而从李彦宏昨天透露的信息来看，他说百度移动端流量已经首次超过PC端，而且这个现象不会被逆转，还说移动端的利润超过PC端这一天也会很快到来(多久到来呢，他没说，不过百度目前的移动端营收应经超过了四成，按这个趋势来看也会很快)。\r\n</p>\r\n<p>\r\n	浪潮之巅里有个著名的观察，说在IT互联网领域，没有一个公司能成功地横跨两个时代，摩托罗拉、诺基亚、DEC、Novell包括微软都是比较现成的例子。但这本书成书于2008年前后，我们看到在此之后国外的Google、国内的腾讯再加上现在的百度和阿里巴巴，都已经显示出从PC互联网向移动互联网时代成功迁移的模样。对比李彦宏的回顾，那些还觉得PC互联网有不可取代优势、还觉得自身业务受移动互联网影响不大的科技企业乃至传统企业，真的需要好好反思并重新评估了。\r\n</p>\r\n<p>\r\n	第二部分是李彦宏对百度移动互联网时代的战略思考。他中间曾经插话马云，说自己每天12点睡觉5点多就起来，因为机会太多，必须做决定放弃很多，并聚焦在自己真正喜欢、真正擅长的事上。移动互联网时代的确看上去突破口要多得多，社交、点商、游戏、健康等等都有大量新机会，也的确有些公司四面开花。但李彦宏要做到\"真正有能力对不属于自己的机会说不\"，他选择了哪个突破口呢？\r\n</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 他说，百度在技术研发上的投资主要投资于人工智能方面。这方面的投入数字有\"几十亿\"。根据百度前三季度的财报，他们在2014年用于研发的支出为48.46亿元人民币，已经超过了2013年全年的41.07亿；而2013年的这项支出，又相比2012年大涨了78.2% ---正是李彦宏开始为移动互联网焦虑的那一年。两年累计近90亿元的支出都砸在百度大脑、深度学习、开放大数据引擎这些人工智能上。\r\n</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 从IT企业最重要的指标之一，人才流向上，可以明显看出百度在整个领域的进展。去年上半年，硅谷最著名的人工智能专家徐伟由Ffacebook跳槽百度，负责硅谷实验室；今年，Google Brain 发明人吴恩达又宣布加盟；加上百度本土的王海峰、余凯，都是在国际人工智能领域享有盛誉的专家和技术大牛。\r\n</p>\r\n<p>\r\n	在搜索引擎本身，以图搜图、知识图谱、问答式搜索等功能也不断上线。一般用户可能对这些功能感受不会太深，毕竟升级已经是互联网产品的常态。但在技术上看，这些技术无一不是机器智能、深度学习、大数据处理等前沿技术的产品化尝试。\r\n</p>\r\n<p>\r\n	李彦宏昨天有句话很有意思，\"一项新技术刚出现时所有人会非常兴奋，期待改变马上发生；但是头几年他们会很失望，它实际的作用好像没那么大。不过回顾整个人类历史尤其技术史，会发现在长期尺度上，绝大多数人还是低谷了技术给人类社会带来的改变。\"\r\n</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 最恰当的例子就是人类基因组测序。2000年左右时这是一项生物学界的嘉年华式盛事，全世界科学家都动员起来分别测定一份标准的人体基因样本。可喧嚣过去后整个领域就沉寂了好几年，早年预期的人类可以通过基因测序改善健康、消灭绝症等远景也没人提了。但是等到2010年左右这个领域重新进入大众视野时，大家发现，从前需要全世界动员去测序一个个体的基因，现在成本已经降低到几百万美元，硅谷一些公司正在把成本降低到几千美元。技术的加速度式发展只能用爆发来形容(有木有想起三体里著名的技术爆炸引理)。\r\n</p>\r\n<p>\r\n	所以即使在昨天那样战火纷飞的场合，也可以从李彦宏这里，得到百度战略的最权威解读与验证。在\"端\"的层面，手机百度、地图、助手、91、贴吧等APP在各个细分领域占领手机屏幕；而在\"云\"的层面，则以深度学习等人工智能技术对这些APP进行后台支持，提供手机无法完成的高强度计算、数据筛选与推荐、非文字搜索等功能，帮助用户将周围的一切进行数字化、运算化，提升整个社会运行的效率与品质，然后，接下来就是顺利成章的，\"用户的需求被满足之后，你的收入和利润都随之而来\"。\r\n</p>\r\n<p>\r\n	所以也可以看到，近百亿的投入所建立的技术壁垒，其实远远比一个APP、一个商业模式要难突破得多。李彦宏为百度设置的护城河并不是贴吧、百科、知道等内容生产部门，而是在技术领域的投入与深钻。所以他昨天在现场也能自然而然地说出\"技术是我的信仰\"这种表达。\r\n</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 当然，人类历史上重兵投入又折戟而归的技术探索也有好几个典型案例。但正如淼叔的导师曾经教导过的那样，\"哲学上，你是不能反对创新的\"，在互联网领域，哲学上，技术上的投入是必须被肯定的，哪怕走了弯路，也是对整个行业做出了试错的贡献。\r\n</p>\r\n<p>\r\n	由于篇幅所限，本文只是就李彦宏本人确认、透露的事实进行分析，没有对他主推的人工智能尤其是深度学习进行详细介绍。淼叔以前写过两篇这个领域的文章，算是大众领域出现得比较早、阅读率也比较高的，有兴趣的同学可以用我的名字加上搜索\"李彦宏在忙深度学习\"\"百度重兵投入深度学习背后的商业模式\"两篇文章了解，也欢迎关注微信公众号 山寨发布会 进行交流。\r\n</p>\r\n<br />', '\0', '', '0', '李彦宏透露百度真正的护城河', '', '1', null, '1');
