INSERT INTO `jm_point_goods` VALUES ('2', '2015-03-24 18:57:22', '\0', null, '29', '<div class=\"para\" style=\"margin:15px 0px 5px;color:#333333;background-color:#FFFFFF;\">\r\n	汉族妇女一般穿窄袖袄、衫、坎肩、裙、裤等。\r\n</div>\r\n<div class=\"para\" style=\"margin:15px 0px 5px;color:#333333;background-color:#FFFFFF;\">\r\n	旗袍，是满族妇女中很流行的一种长袍，后来也成为汉族妇女主要的服饰之一。清代满人穿的旗袍与后来称为旗袍的服装是有着很大的区别的，但后来的旗袍是在满人这种长袍基础上发展而来的。旗袍，最初极为宽大，腰身为筒式，后来渐渐变小。圆领、右衽、高领或低领，清末时高领能高达二寸半左右。旗袍有单、夹、棉、皮之分，都按季节的变化来区分。袍色一般浅淡居多。满族妇女穿旗袍时，大多喜欢在旗袍外面罩上一件坎肩。\r\n</div>\r\n<div class=\"para\" style=\"margin:15px 0px 5px;color:#333333;background-color:#FFFFFF;\">\r\n	清代的汉族妇女服饰大多沿袭明代；一般是上着袄、衫、下着裙，后来不穿裙，改穿裤。\r\n</div>\r\n<div class=\"para\" style=\"margin:15px 0px 5px;color:#333333;background-color:#FFFFFF;\">\r\n	袄衫多是圆领，右衽，大襟，对襟，琵琶襟，大袖，且锦绣镶边。袄的质料多用棉、缎、衫多用纱、罗、绸等，也有舍织蜡染的花布。颜色以天青、湖蓝、粉、白、红等为多。冬天也用貂、狐之类的皮毛的。镶边也是极为复杂、精美、当时有“十八镶”的说法。\r\n</div>\r\n<div class=\"para\" style=\"margin:15px 0px 5px;color:#333333;background-color:#FFFFFF;\">\r\n	一般好的裙，式样较多。如苏州妇女的“白褶裙”，整幅裙多达上百个裙前面有类似蔽膝，左右打褶的“马面裙”，又叫“月华裙”，因为裙的每个褶中，五色俱全，好似皎洁的月亮晕耀光华而得名；又有“弹墨裙”，是用墨弹在裙口子上，雅素而别具风格，象一幅水墨画，渲染出千姿百态的变化；此外还有“凤尾裙”、“鱼鳞百褶裙”，“洋印裙”、“金泥簇蝶裙”、“绣凤凰裙”、“满花裙”、“一块玉裙”、“鬼子栏杆裙”、“饰件镶滚裙”、“叮铛裙”等等，这些裙各具特色，又仅突出了妇女修长的身段，又显示了华丽而丰富的装饰美。\r\n</div>\r\n<div class=\"para\" style=\"margin:15px 0px 5px;color:#333333;background-color:#FFFFFF;\">\r\n	清代未成年女子都穿裤。裤式为高腰、合裆、裤长至脚，造型不象男子的裤那么肥阔。穿的时候用一条长带系腰，余下的部分作为装饰。女子的裤比男子的色彩鲜艳，花纹丰富，可以按自己的喜欢选用。另外女子的裤口还有一个共同点，即在裤脚上饰有各种镶边。光绪时，裤口要做好几层镶边，第一道最宽，二、三道就窄了。到了宣统的时候。裤管又要细窄，镶边也比以前减少了。\r\n</div>', null, '10', '0', '5000', '品牌男装', '450.00', 'gift201503241857221', '', '0', '\0', '', '品牌男装', '品牌男装', '0', '', '\0', '0.00', '0', '427165');
INSERT INTO `jm_point_goods` VALUES ('3', '2015-03-24 18:57:47', '\0', null, '2', '<p>\r\n	<span style=\"color:#333333;background-color:#FFFFFF;\">服饰的变迁是一部历史，是一个时代发展的缩影。它是这个时代进步、文明、兴旺发达、繁荣昌盛的象征。它在记录历史变革的同时，也映衬着一种民族的精神，传承着当地的历史文化风俗，女装更是其中不可缺少的一部分。女士穿着的衣物统称为女装。女装品牌与款式的多元化推动了时装的发展。女装使女人倍添姿彩，女装为产业增添亮点。</span>\r\n</p>\r\n<span style=\"color:#333333;background-color:#FFFFFF;\">\r\n<div class=\"para\" style=\"margin:15px 0px 5px;color:#333333;background-color:#FFFFFF;\">\r\n	贵妇的便装却时兴瘦，细、长，与以前各个时期不太相同，衣着的配色也打破了唐代以红紫、\r\n	<div class=\"lemma-picture text-pic layout-right\" style=\"margin:0px 0px 3px 20px;border:1px solid #E0E0E0;\">\r\n		<span class=\"description\" style=\"color:#555555;line-height:15px;font-family:宋体;font-size:12px;font-style:normal;font-weight:normal;\">明代女装</span>\r\n	</div>\r\n绿、青为主的惯例，多采用各种间色粉紫、黑紫、葱白、银灰、沉香色等。色调淡雅、文静，合理地运用了比较高级的中性灰色调，衣饰花纹也由比较规则的唐代图案改成了写生的折枝在纹，显得更加生动、活泼、自然。\r\n</div>\r\n<div class=\"para\" style=\"margin:15px 0px 5px;color:#333333;background-color:#FFFFFF;\">\r\n	一般平民女子，尤其是劳动妇女或婢仆等，仍然穿窄袖衫襦。只是比晚唐、五代时的更瘦更长，颜色以白色为主，其它也有浅绛、浅青等。裙裤也比较瘦短，颜色以青、白色为最普遍。\r\n</div>\r\n<div class=\"para\" style=\"margin:15px 0px 5px;color:#333333;background-color:#FFFFFF;\">\r\n	总的看来，宋代妇女的装束，除了北宋时曾一度流行的大袖衫襦，肥阔的裙裤外，窄、瘦、长、奇是这一时期妇女服装的主要特征。\r\n</div>\r\n<div class=\"para\" style=\"margin:15px 0px 5px;color:#333333;background-color:#FFFFFF;\">\r\n	衫是一种最普通的衣式，宋代妇女的衫多半用刺绣为装饰。大多是圆领、交领、直领、对襟，腰身清秀苗条，下摆多，有较长的开气，衣料一般是用罗、纱、绫、缣等轻软的料子。\r\n</div>\r\n<div class=\"para\" style=\"margin:15px 0px 5px;color:#333333;background-color:#FFFFFF;\">\r\n	襦与袄是相似的衣式，襦的造型短小，一般到腰部，对襟，侧缝下摆处开气，袖端细长，衣身也比较窄。襦有单襦，复襦，单襦与衫相近，复襦与袄相近。通常贵族妇女的服色以紫红、黄色为主，用绣罗并加上刺绣。平常的妇女多以青、白、褐色为多，上了年纪的妇女也喜欢穿紫红色的襦。\r\n</div>\r\n<div class=\"para\" style=\"margin:15px 0px 5px;color:#333333;background-color:#FFFFFF;\">\r\n	而袄大多是有里子或夹衬棉紧的一种冬衣，对襟，侧缝下摆开气，又叫“旋袄”，可以代替袍。宋代对袍的穿用是有限制的，除命妇可以穿外，其余大多数的民间女子是不准穿的。后规定命妇的袍色，三品以上是紫色，绣着仙鹤和芝草，三品以下律用黄色，并不绣花样。可以随各人的喜好来选择。\r\n</div>\r\n<div class=\"para\" style=\"margin:15px 0px 5px;color:#333333;background-color:#FFFFFF;\">\r\n	窄袖衣是宋代女子中普遍流行的一种便服。式样是对襟、交领、窄袖、衣长至膝。特点是非常瘦窄，甚至贴身。由于这种服装式明代的女装已与前代不同，但在明初还能看到舍人和元代的影响。左衽、窄袖长袍仍可见到。一般女子时兴窄袖的衫襦、背子、长裙等。明代妇女的裙式变化比较多，是一种流行的服饰。明代贵族妇女的服色规定用真红，鸦青和黄色，而一般女子只能用紫绿，桃红和浅色。\r\n</div>\r\n</span>\r\n<p>\r\n	<br />\r\n</p>', null, '0', '41', '2000', '女装', '12.00', 'gift201503241857471', '', '0', '\0', '\0', '女装', '女装', '0', '', '\0', '0.00', '0', '427166');
INSERT INTO `jm_point_goods` VALUES ('4', '2015-03-24 18:58:25', '\0', null, '2', '<div class=\"para\" style=\"margin:15px 0px 5px;color:#333333;background-color:#FFFFFF;\">\r\n	<b>第一，</b>挑选汽车坐垫，最重要的就是<a href=\"http://baike.baidu.com/view/11676076.htm\" target=\"_blank\">舒适度</a>的把握，其中有健康气囊（非汽车健康气囊是一种腰背部充气的支撑部件）的为最佳，这种材质的坐垫的健康气囊会根据您的身形自动调整位置，为车主提供一个舒适的驾驶环境，让车主摆脱因驾车带来的腰酸背痛的痛楚；\r\n</div>\r\n<div class=\"para\" style=\"margin:15px 0px 5px;color:#333333;background-color:#FFFFFF;\">\r\n	<b>第二，</b>挑选汽车坐垫，一定要注意其摩擦力，很多人有遇到紧急刹车，身体就从坐垫上出溜出去的经历，这就是因为购买的汽车坐垫摩擦力不足的原因导致的，因此大家在选择汽车坐垫的时候，一定要选择有足够摩擦力的品牌，避免身体滑动，这是保证出行安全的需要；\r\n</div>\r\n<div class=\"para\" style=\"margin:15px 0px 5px;color:#333333;background-color:#FFFFFF;\">\r\n	<b>第三，</b>购选汽车坐垫，还要关注坐垫与车子的匹配程度，好马配好鞍，好车要有好座，不适合的汽车坐垫不仅影响车辆整体印象，还会反映出车主本人的品味，谁也不想被人称为是“大老粗”，专家给出建议：挑选的汽车坐垫整体颜色要和整个内饰颜色主调一致，在侧重于主人偏好的同时，尽量做到和谐搭配。\r\n</div>\r\n<div class=\"para\" style=\"margin:15px 0px 5px;color:#333333;background-color:#FFFFFF;\">\r\n	<b>第四，</b>首先，要找一家好的店铺。别看好评率，而是要看他里面的中差评详细内容，从而判断掌柜是个什么样的人。会不会处理售后问题，会不会为自己的错误承担责任，出现问题会不会主动去解决。因为一家店不出错是几乎不可能的事情，好评率是可以砸钱买的，这些，买不到。\r\n</div>\r\n<div class=\"para\" style=\"margin:15px 0px 5px;color:#333333;background-color:#FFFFFF;\">\r\n	<b>第五，</b>最后，看宝贝描述。细节图啊，掌柜说的话啊，都要仔细看一遍。因为汽车坐垫的通用适用度在95%左右，还是有些区别的。也有一些别的需要注意的小细节，都会在宝贝描述里面显示，这个如果不看仔细，容易吃亏的.\r\n</div>\r\n<div class=\"anchor-list\" style=\"color:#000000;background-color:#FFFFFF;\">\r\n	<a name=\"5\" class=\"anchor-1\"></a><a name=\"sub1822315_5\" class=\"anchor-1\"></a><a name=\"保养技巧\" class=\"anchor-1\"></a>\r\n</div>\r\n<h2 class=\"headline-1\" style=\"background:url(&quot;http://baike.bdimg.com/static/lemma/view/img/titleEditLine.png&quot;) #FFFFFF;color:#000000;text-indent:0px;\">\r\n	<span class=\"headline-1-index\" style=\"background:#519CEA;color:#FFFFFF;line-height:24px;font-size:16px;\">5</span><span class=\"headline-content\" style=\"background:#FFFFFF;line-height:24px;\">保养技巧</span><span class=\"text_edit editable-title\" style=\"background:#FFFFFF;\"><a class=\"nslog:1019\" href=\"http://baike.baidu.com/link?url=C-lQv-seJa_rcHo69-aMlLtK_anq9xY-iEs6IDMysYqfu1q7DAgwburiIn9mtp3hxTqXSmp14aQOxlk4CIIZXa#\">编辑</a></span>\r\n</h2>\r\n<div class=\"para\" style=\"margin:15px 0px 5px;color:#333333;background-color:#FFFFFF;\">\r\n	如果爱车安装的是真皮座套或坐垫，那么建议你新车或<a href=\"http://baike.baidu.com/view/248338.htm\" target=\"_blank\">改装</a>完皮套后15天给皮面涂上一层保护蜡。皮套尽量距热源远一些，否则会导致皮革干裂。避免长时间在<a href=\"http://baike.baidu.com/view/8890.htm\" target=\"_blank\">阳光</a>下暴晒，那会导致皮革褪色。经常实施清洁保养，每周使用吸尘器吸去尘灰，用皮革专业柔软清洁剂清洁，清洁后不要用吹风机去快速吹干皮革，最好是自然风干。\r\n</div>\r\n<div class=\"para\" style=\"margin:15px 0px 5px;color:#333333;background-color:#FFFFFF;\">\r\n	如果你是选用的织物座套或坐垫，那么干洗水洗均可，干洗效果最佳。水洗时请用低含碱量洗涤用品，水洗前，在30度温水中浸泡10分钟。手洗时，用软毛刷沾洗剂刷洗，整平后自然阴干。最好不要勿机洗，也不要脱水。\r\n</div>\r\n<div class=\"para\" style=\"margin:15px 0px 5px;color:#333333;background-color:#FFFFFF;\">\r\n	如果您选购了<a href=\"http://baike.baidu.com/view/5962.htm\" target=\"_blank\">羊毛</a>等高档面料的坐垫，我们建议您到最重要的是，日常使用中尽量避免严重污损，否则频繁的洗涤会使毛质坐垫质地变差。店长是在“品牌男装”公司市场部的统一形象设计，统一进货渠道，统一经营策略，统一管理体制的标准化模式指导下，专卖店的经营者和指挥者，其主要职责如下：\r\n</div>\r\n<div class=\"para\" style=\"margin:15px 0px 5px;color:#333333;background-color:#FFFFFF;\">\r\n	<br />\r\n□ 按期提出本店进货、销售等经济指标计划，作为进、销货目标，并组织贯彻实施。\r\n</div>\r\n<div class=\"para\" style=\"margin:15px 0px 5px;color:#333333;background-color:#FFFFFF;\">\r\n	<br />\r\n□ 负责按商品进货原则组织进货。\r\n</div>\r\n<div class=\"para\" style=\"margin:15px 0px 5px;color:#333333;background-color:#FFFFFF;\">\r\n	<br />\r\n□ 负责指挥店堂布置和商品之陈列。\r\n</div>\r\n<div class=\"para\" style=\"margin:15px 0px 5px;color:#333333;background-color:#FFFFFF;\">\r\n	<br />\r\n□ 执行专卖的价格规定。\r\n</div>\r\n<div class=\"para\" style=\"margin:15px 0px 5px;color:#333333;background-color:#FFFFFF;\">\r\n	<br />\r\n□ 根据顾客流动规律安排营业时间和营业员的班次。\r\n</div>\r\n<div class=\"para\" style=\"margin:15px 0px 5px;color:#333333;background-color:#FFFFFF;\">\r\n	<br />\r\n□ 抓好导购员遵守店堂纪律、举止姿态、仪容仪表等规定的贯彻。\r\n</div>\r\n<div class=\"para\" style=\"margin:15px 0px 5px;color:#333333;background-color:#FFFFFF;\">\r\n	<br />\r\n□ 经常深入货场，言教、身教导购员做好导购工作。\r\n</div>\r\n<div class=\"para\" style=\"margin:15px 0px 5px;color:#333333;background-color:#FFFFFF;\">\r\n	<br />\r\n□ 主动适时地组织实施店铺之有效的促销工作。\r\n</div>\r\n<div class=\"para\" style=\"margin:15px 0px 5px;color:#333333;background-color:#FFFFFF;\">\r\n	<br />\r\n□ 定期组织清仓查库工作，并做好补货和滞销物资的处理工作。\r\n</div>\r\n<div class=\"para\" style=\"margin:15px 0px 5px;color:#333333;background-color:#FFFFFF;\">\r\n	<br />\r\n□ 注意经常了解顾客对商店及商品的反映和需求，不断为顾客提供满意的服务。\r\n</div>\r\n<div class=\"para\" style=\"margin:15px 0px 5px;color:#333333;background-color:#FFFFFF;\">\r\n	<br />\r\n□ 进行简易核算，掌握经营效益。\r\n</div>', null, '1', '40', '1600', '夏季流行服装', '88.00', 'gift201503241858251', '新品', '0', '\0', '', '夏季流行服装', '夏季流行服装', '0', '', '\0', '0.00', '0', '427167');
